import React from "react";

const Profile = () => {
  return (
    <>
      <div>
        <h5> Ruhul Sinbad </h5>
        <h5> ruhulsinbad@gmail.com </h5>
      </div>
      <div>
        <h6> If it works! </h6>
        <p> Don't touch it </p>
      </div>
    </>
  );
};

export default Profile;
